import React, { useEffect } from 'react';
//import { Link, withRouter } from 'react-router-dom';
import { getData } from '../actions/getNyc';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import DataCard from './DataCard';

const DataView = ({ getData, data }) => {
	useEffect(() => {
		getNyc(), getGaurdian();
	}, [getData, getGaurdian]);

	return <DataCard />;
};

DataView.propTypes = {
	DataView: PropTypes.func.isRequired,
	data: PropTypes.object.isRequired
};
const mapStateToProps = state => ({
	data: state.data
});

export default connect(mapStateToProps, { getData })(DataView);
